'function e$d(){var a;a=new xld;a.a+=\'<div class="center-align" style="margin-top: 15%;">\\n    <img style="margin-top: -120px; width: 100%;" src="data:image/png;base64,\';a.a+=\'\';a.a+=\'AAAAADECAoAAAAAAECMoAAAAAAAAMQICgAAAAAAQIygAAAAAAAAxAgKAAAAAABAjKAAAAAAAADECAoAAAAAAECMoAAAAAAAAMQICgAAAAAAQIygAAAAAAAAxAgKAAAAAABAjKAAAAAAAADECAoAAAAAAECMoAAAAAAAAMQICgAAAAAAQIygAAAAAAAAxAgKAAAAAABAjKAAAAAAAADECAoAAAAAAECMoAAAAAAAAMQICgAAAAAAQIygAAAAAAAAxP4nwACKqqQDrMoOqgAAAABJRU5ErkJggg==" />\\n    <h4 style="font-weight: 300;">What is Material Design?<\\/h4>\\n    <p>Created and designed by Google, Material Design is a design language that combines the classic principles of successful design along with innovation and technology. Google\\\'s goal is to develop a system of design that allows for a unified user experience across all their products on any platform.<\\/p>\\n    <div class="row" style="margin-bottom: 80px; padding: 5%;">\\n        <div class="col s12 m4 l4">\\n            <img style="width: 100%" src="data:image/png;base64,"/>\\n            <h4 style="font-weight: 300;">Material is the metaphor<\\/h4>\\n            <p>The metaphor of material defines the relationship between space and motion. The idea is that the technology is inspired by paper and ink and is utilized to facilitate creativity and innovation. Surfaces and edges provide familiar visual cues that allow users to quickly understand the technology beyond the physical world.<\\/p>\\n        <\\/div>\\n\\n        <div class="col s12 m4 l4">\\n            <img style="width: 100%" src="data:image/png;base64,\';a.a+=\'"/>\\n            <h4 style="font-weight: 300;">Bold, graphic, intentional<\\/h4>\\n            <p>Elements and components such as grids, typography, color, and imagery are not only visually pleasing, but also create a sense of hierarchy, meaning, and focus. Emphasis on different actions and components create a visual guide for users.<\\/p>\\n        <\\/div>\\n\\n        <div class="col s12 m4 l4">\\n            <img style="width: 100%" src="data:image/png;base64,\';a.a+=\'"/>\\n            <h4 style="font-weight: 300;">Motion provides meaning<\\/h4>\\n            <p>Motion allows the user to draw a parallel between what they see on the screen and in real life. By providing both feedback and familiarity, this allows the user to fully immerse him or herself into unfamiliar technology. Motion contains consistency and continuity in addition to giving users additional subconscious information about objects and transformations.<\\/p>\\n        <\\/div>\\n    <\\/div>\\n<\\/div>\';return a.a}\n',
